// Try to reach API directly
cy.request({
    url: "http://localhost:8787/health", // Assuming health endpoint or just root
    failOnStatusCode: false
}).then(function (response) {
    cy.log("API Response: ".concat(response.status));
    expect(response.status).to.not.equal(404); // Should be reachable
});

// Visit login page and check if we can spy on the request
cy.intercept("POST", "**/auth/login").as("loginRequest");
cy.visit("/login");
// We can't easily check env var of the app from here without exposing it, 
// but we can check if a request is made when we click login
cy.get('[data-cy="inp-email"]').type("test@test.com");
cy.get('[data-cy="inp-password"]').type("password");
cy.get('[data-cy="btn-login"]').click();
cy.wait("@loginRequest", { timeout: 5000 }).then(function (interception) {
    assert.isNotNull(interception.request.url, "Request was made");
    cy.log("Request URL: ".concat(interception.request.url));
});
